import techniquesMindMap from '../components/203.png';
import knowledgeAreaAndTasks from '../components/202.png';
import s2 from '../components/203.png';
import Card from '../components/Card';
import SimpleCard from '../components/Card';
import ImgMediaCard from '../components/Card';
import ImageModal from '../components/ImageModal';
import { useState } from 'react';

function openImage(s){
    <ImageModal src={s} />
}

function FavoritesPage(props) {
    const [ modalIsOpen, setModalIsOpen ] = useState(false);

    function openModal(){
        setModalIsOpen(true);
    }

    function closeModal(){
        setModalIsOpen(false);
    }

    return (
    <div>Favorites Page
        <div>
        <ImgMediaCard onClick={openModal} src={techniquesMindMap} title="Techniques Mind Map" description="See how business analysis techniques link together"/>
            <ImgMediaCard src={knowledgeAreaAndTasks}/>
            <ImageModal />
            {modalIsOpen && <ImageModal src={techniquesMindMap}/> }
        </div>
        
    </div>
    );
    
}

export default FavoritesPage;
